import React, { useState } from 'react';
import axios from 'axios';
import { useNavigate, Link } from 'react-router-dom';
import { EnvelopeIcon, LockClosedIcon } from '@heroicons/react/24/outline';
import './Login.css';
import girl from './images/sitting-2.png';
import image12 from './images/download.png';
import image13 from './images/Avatar Group.png';
import image1 from './images/1.png';
import image2 from './images/10.png';
import image3 from './images/12.png';
import image4 from './images/13.png';
import image5 from './images/14.png';
import image6 from './images/15.png';
import image7 from './images/16.png';
import image8 from './images/17.png';
import image9 from './images/20.png';
import image10 from './images/21.png';
import image11 from './images/23.png';
import ellipse from './images/Ellipse 1.png';

export default function Login({ setIsAuth }) {
  const [username, setUsername] = useState('');
  const [password, setPassword] = useState('');
  const [msg, setMsg] = useState('');
  const navigate = useNavigate();

  const handleLogin = async (e) => {
    e.preventDefault();
    try {
      const res = await axios.post('http://localhost:5000/api/login', { username, password });
      console.log('Login response:', res.data);
      localStorage.setItem('token', res.data.token);
      setIsAuth(true);
      navigate('/home');
    } catch (err) {
      setMsg(err.response?.data?.message || 'Error');
    }
  };

  return (
    <div className="login-page">
      <div className="login-left">
        <div className="login-content">
          <h1 className="welcome-message">Welcome Back</h1>


            <div className="form-group">
              <div className="input-with-icon">
                <EnvelopeIcon className="input-icon" />
                <input 
                  id="email"
                  type="email" 
                  placeholder="     Email" 
                  value={username} 
                  onChange={e => setUsername(e.target.value)} 
                  required 
                />
              </div>
            </div>

            <div className="form-group">
              <div className="input-with-icon">
                <LockClosedIcon className="input-icon" />
                <input 
                  id="password"
                  type="password" 
                  placeholder="     Password" 
                  value={password} 
                  onChange={e => setPassword(e.target.value)} 
                  required 
                />
              </div>
            </div>

            <Link to="/resetPassword" className="forgot-password">
              Forgot Password?
            </Link>

            <button type="submit" className="login-btn" onClick={handleLogin}>Log in</button>


          <div className="signup-link">
            Don't Have an Account? <Link to="/register">Sign up</Link>
          </div>

          {msg && <div className="error-message">{msg}</div>}
        </div>
      </div>

      <div className="login-right">
        <div className="image-container">
          <div className="main-image">
            <img src={girl} className="girl-image" alt="Girl sitting" />
            <img src={ellipse} className="ellipse" alt="Ellipse" />
          </div>
          <div className="floating-images">
            <div className="floating-image image-1">
              <img src={image1} alt="Feature 1" />
            </div>
            <div className="floating-image image-2">
              <img src={image2} alt="Feature 2" />
            </div>
            <div className="floating-image image-3">
              <img src={image3} alt="Feature 3" />
            </div>
            <div className="floating-image image-4">
              <img src={image4} alt="Feature 4" />
            </div>
            <div className="floating-image image-5">
              <img src={image5} alt="Feature 5" />
            </div>
            <div className="floating-image image-6">
              <img src={image6} alt="Feature 6" />
            </div>
            <div className="floating-image image-7">
              <img src={image7} alt="Feature 7" />
            </div>
            <div className="floating-image image-8">
              <img src={image8} alt="Feature 8" />
            </div>
            <div className="floating-image image-9">
              <img src={image9} alt="Feature 9" />
            </div>
            <div className="floating-image image-10">
              <img src={image10} alt="Feature 10" />
            </div>
            <div className="floating-image image-11">
              <img src={image11} alt="Feature 11" />
            </div>
            <div className="floating-image image-12"></div>
          </div>
          <svg className="connecting-lines" viewBox="0 0 400 400" preserveAspectRatio="none">
            <defs>
              <pattern id="dashed" patternUnits="userSpaceOnUse" width="10" height="10">
                <path d="M 0 5 L 10 5" stroke="#3b82f6" strokeWidth="2" strokeDasharray="2,2"/>
              </pattern>
            </defs>
            <line x1="200" y1="200" x2="100" y2="100" stroke="url(#dashed)" strokeWidth="2" />
            <line x1="200" y1="200" x2="300" y2="100" stroke="url(#dashed)" strokeWidth="2" />
            <line x1="200" y1="200" x2="100" y2="300" stroke="url(#dashed)" strokeWidth="2" />
            <line x1="200" y1="200" x2="300" y2="300" stroke="url(#dashed)" strokeWidth="2" />
            <line x1="200" y1="200" x2="50" y2="150" stroke="url(#dashed)" strokeWidth="2" />
            <line x1="200" y1="200" x2="350" y2="150" stroke="url(#dashed)" strokeWidth="2" />
            <line x1="200" y1="200" x2="50" y2="250" stroke="url(#dashed)" strokeWidth="2" />
            <line x1="200" y1="200" x2="350" y2="250" stroke="url(#dashed)" strokeWidth="2" />
          </svg>
        </div>
      </div>
    </div>
  );
}
